import React from "react";
import s from "./style.module.scss";
import Image from "../../components/image/img";
import Text from "../../components/Text/text";
import Link from "../../components/Link/link";
import Button from "../../components/button/button";

export default function Footer() {
  return (
    <div className={s.footer}>
      <div className={s.footer_flex}>
        <div className={s.footer_logo}>
          <Image src={"/assets/footer-logo.svg"} />
        </div>
        <div className={s.footer_flinks}>
          <div className={s.footer_links}>
            <Text
              text={"Categories"}
              fsize={16}
              fontFamily={"Inter"}
              color={"#ABABFA"}
              uppercase={"uppercase"}
            />
            <Link
              text={"Case Studies"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
            <Link
              text={"Mobile Technology"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
            <Link
              text={"Data Insights"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
          </div>
          <div className={s.footer_links}>
            <Text
              text={"Categories"}
              fsize={16}
              fontFamily={"Inter"}
              color={"#ABABFA"}
              uppercase={"uppercase"}
            />
            <Link
              text={"Case Studies"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
            <Link
              text={"Mobile Technology"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
            <Link
              text={"Data Insights"}
              color={"#ABABFA"}
              fsize={14}
              fontFamily={"Inter"}
            />
          </div>
        </div>
        <div className={s.footer_btns}>
          <Text
            text={"Quality tech news In your inbox. Every week."}
            fsize={29}
            fontFamily={"Inter"}
            color={"#FFFFFF"}
            // width={70}
          />
          {/* <Text
            text={"In your inbox. Every week."}
            fsize={29}
            fontFamily={"Inter"}
            color={"#FFFFFF"}
          /> */}
          <Button
            text={"Email address"}
            color={"#5C5CFF"}
            bg={"#1B1B4D"}
            border={"1px solid #8989F8"}
            br={4}
            uppercase={"unset"}
            fsize={20}
          />
          <Button
            text={"SUBSCRIBE"}
            color={"white"}
            bg={"#5C5CFF"}
            border={"1px solid #8989F8"}
            br={4}
            uppercase={"unset"}
            fsize={20}
          />
        </div>
      </div>
    </div>
  );
}
